    seen = set()

    # Generate numbers for each case and add to the heap
    # Case 1: p^4
    for p in primes:
        num = p**4
        if num not in seen:
            heapq.heappush(min_heap, num)
            seen.add(num)

    # Case 2: p^3 * q
    for p in primes:
        for q in primes:
            if p != q:
                num = p**3 * q
                if num not in seen:
                    heapq.heappush(min_heap, num)
                    seen.add(num)

    # Case 3: p^2 * q^2
