        for q in primes:
            if p <= q:
                num = p**2 * q**2
                if num not in seen:
                    heapq.heappush(min_heap, num)
                    seen.add(num)

    # Case 4: p^2 * q * r
    for p in primes:
        for q, r in combinations_with_replacement(primes, 2):
            if p != q and p != r:
                num = p**2 * q * r
                if num not in seen:
                    heapq.heappush(min_heap, num)
                    seen.add(num)

