def phi(n: int) -> int:
    """Calculate Euler's Totient function."""
    result = n
    p = 2
    while p * p <= n:
        if n % p == 0:
            while n % p == 0:
                n //= p
            result -= result // p
        p += 1
    if n > 1:
        result -= result // n
    return result

def count_fixed(d: int, n: int, k: int) -> int:
    """Count the number of fixed arrangements for a given divisor d."""
    # For each divisor d, count the number of ways to arrange the beads
    # such that the arrangement is fixed by a rotation of d positions.
    # This is equivalent to counting the number of ways to partition
    # the beads into cycles of length d.
