def is_minimal_cover(n, pairs):
    covered = set()
    for pair in pairs:
        covered.update(pair)
    if len(covered) != n:
        return False
    for pair in pairs:
        temp_pairs = pairs - {pair}
        temp_covered = set()
        for temp_pair in temp_pairs:
            temp_covered.update(temp_pair)
        if len(temp_covered) == n:
            return False
    return True

